    var e12storage = {};
    e12storage.webdb = {};
    e12storage.webdb.db = null;
    
    document.addEventListener("deviceready", init, false);
    
    e12storage.webdb.open = function() {
      var dbSize = 10 * 1024 * 1024; // 10MB
      e12storage.webdb.db = openDatabase("e12storage", "1.0", "E12Storage manager", dbSize);
    }

    e12storage.webdb.createTable = function() {
      var db = e12storage.webdb.db;
      db.transaction(function(tx) {
        tx.executeSql("CREATE TABLE IF NOT EXISTS E12STORAGE( KEY, DATA ) ", []);
      });
    }

    e12storage.webdb.setStorageItem = function(keyId, keyValue) {
      var db = e12storage.webdb.db;
      db.transaction(function(tx){
        tx.executeSql("INSERT INTO E12STORAGE( KEY, DATA ) VALUES (?,?)",
            [keyId, keyValue],
            e12storage.webdb.onSuccess,
            e12storage.webdb.onError);
       });
    }

    //callback from GWT or setStorageItem
    e12storage.webdb.getStorageItem = function(keyId, callback) {
        e12storage.webdb.open();
        var db = e12storage.webdb.db;
        db.transaction(function(tx) {
          tx.executeSql("SELECT * FROM E12STORAGE WHERE KEY = ? ", [keyId], 
        		onSelectSuccess,
          		e12storage.webdb.onError);
        });
        var onSelectSuccess = function( tx, rs )
        {
        	var returnValue = "";
        	var len = rs.rows.length;
        	if( len > 0 )
        	{
        		returnValue = rs.rows.item(0).DATA;
        	}
        	callback( returnValue );
        };
        
    }

    e12storage.webdb.updateStorageItem = function(keyId, keyValue) {
        e12storage.webdb.open();
    	var db = e12storage.webdb.db;
        db.transaction(function(tx) {
          tx.executeSql( "UPDATE E12STORAGE SET DATA = ?  WHERE KEY ='"+keyId+"' ", [keyValue] );
        });
    }
    
    e12storage.webdb.onError = function(tx, e) {
      console.log("There has been an error: " + e.message);
    }

    e12storage.webdb.onSuccess = function(tx, rs) {
        console.log("Success!! ");
    }


    function init() {
    	e12storage.webdb.open();
    	e12storage.webdb.createTable();
    }

    function setStorageItem(keyId, keyValue) {
        var callback = function( callbackVal ){
            if( callbackVal == "" )
            {
                e12storage.webdb.setStorageItem( keyId, keyValue );
            }
            else
            {
                e12storage.webdb.updateStorageItem( keyId, keyValue );
            }
        };
        e12storage.webdb.getStorageItem(keyId, callback);
    }
    
    //callback from GWT 
    function getStorageItem(keyId, callback) {
        try
        {	
            e12storage.webdb.getStorageItem( keyId, callback );
        }
        catch(e)
        {
            console.log(" exception ["+e.getMessage()+"]");
        }
    }
    
    /**
     * Returns the number of items from E12STORAGE table of local DB .
     *
     * @return number of items in this E12STORAGE table
     */
    function getStorageItemLenght( callback ){
    	e12storage.webdb.open();
        var db = e12storage.webdb.db;
        db.transaction(function(tx) {
          tx.executeSql("SELECT * FROM E12STORAGE ", [], 
        		onSelectSuccess,
          		e12storage.webdb.onError);
        });
        var onSelectSuccess = function( tx, rs )
        {
        	callback( ""+rs.rows.length );
        };
    }
    
    /**
     * Returns the key at the specified index.
     *
     * @param index the index of the key
     * @return the key at the specified index in E12STORAGE table
     */
    function getStorageItemKey( index, callback ){
    	e12storage.webdb.open();
        var db = e12storage.webdb.db;
        db.transaction(function(tx) {
          tx.executeSql("SELECT * FROM E12STORAGE ", [], 
        		onSelectSuccess,
          		e12storage.webdb.onError);
        });
        var onSelectSuccess = function( tx, rs )
        {
        	var returnValue = "";
        	var len = rs.rows.length;
        	if( len > 0 )
        	{
        		returnValue = rs.rows.item( index ).KEY;
        	}
        	callback( returnValue );
        };
    }
    
    /**
	   * Removes the item in the E12STORAGE table associated with the specified key.
	   *
	   * @param key the key to a value in the E12STORAGE table
	   */
    function removeStorageItem( key ){
    	e12storage.webdb.open();
        var db = e12storage.webdb.db;
        db.transaction(function(tx) {
          tx.executeSql("DELETE FROM E12STORAGE WHERE KEY = ? ", [ key ] );
        });
    }
    

